import {connect} from 'react-redux';


function AllPosts({posts}) {
    return (
        <div>
                {posts.map(post => 
                <div class="card" style={{width: "18rem"}}>
                <img src={`${post.userName}`} class="card-img-top" alt="..."/>
                <div class="card-body">
                    <h1>{post.firstname}</h1>
                  <p class="card-text">{post.text}</p>
                </div>
              </div>

                )}

<img src="https://www.google.com/search?q=%D0%BA%D0%B0%D1%80%D1%82%D0%B8%D0%BD%D0%BA%D0%B8&client=ubuntu&hs=QyL&sxsrf=ALeKk00QVbSrSiSmae4S1Cmnse1G14CuHw:1610055879696&tbm=isch&source=iu&ictx=1&fir=jDcbsvuE1hy7HM%252Cfa1y3PKCxAo4-M%252C_&vet=1&usg=AI4_-kR8WY7dzli8SHxE-8WZo3HWbNFyOg&sa=X&ved=2ahUKEwiL5JvG5YruAhWPl4sKHRf4C84Q9QF6BAgJEAE#imgrc=jDcbsvuE1hy7HM" class="card-img-top" alt="..."/>

        </div>
    )
}

const mapStateToProps = state => {

    return {
        posts: state.posts.posts
    }
}

export default connect(mapStateToProps,null)(AllPosts);
